	public Triangle[] getTri(Color c, float scale, boolean rotate180, boolean smoothTris) {
		switch(name) {
		case "Airplane":
		case "Guitar":
		case "Boat":
			return getT(1, 0, scale, 0, c, true, true, false, rotate180, smoothTris, true, 0.6f, true);
		case "Bishop":
			return getT(3, 0, scale, -0.00000739098f, c, true, true, false, rotate180, smoothTris, true, .625f, false);
		case "Pawn":
			return getT(2, 0, scale, -0.9447673f, c, true, true, false, rotate180, smoothTris, true, .4875f, false);
		case "Knight":
			return getT(2, 0, scale, -0.0000026226f, c, true, true, true, !rotate180, smoothTris, true, .4f, false);
		case "Queen":
			return getT(2, 0, scale, -0.00000739098f, c, true, true, false, rotate180, smoothTris, true, .5f, false);
		case "King":
			return getT(2, 0, scale, -0.00000739098f, c, true, true, false, rotate180, smoothTris, true, .5f, false);
		case "Rook":
			return getT(2, 0, scale, -0.0000100136f, c, true, true, false, rotate180, smoothTris, true, .3f, false);
		case "Board base":
			return getT(1, 0, scale, 0, c, false, false, false, rotate180, smoothTris, false, 0, false);
		case "Creation":
			return getT(1, 0, scale, 0, c, false, false, true, rotate180, smoothTris, true, .7f, false);
		case "Highlight":
			return getT(1, 0, scale, 0, c, false, false, false, rotate180, smoothTris, true, .7f, false);
		default:
			return null;
		}
	}
	
	public Triangle[] getPart(Triangle[] t, int n) {
		Triangle[] ret = new Triangle[n];
		for (int x = 0; x < ret.length; x++)
			ret[x] = t[x];
		return ret;
	}
	
	/**
	 * 
	 * @param numTypes = number of types of things stored in each vertex (usually VERTEX, NORMAL)
	 * @param offset = offset of vertices (usually 0, must be less than numTypes
	 * @param scale = scale the size of the object
	 * @param distanceFromO = value of minimum z value of all vertices (added back so bottom is at 0, 0, 0
	 * @param color = color of the entire object
	 * @param swapYZ = swap y and z axes (for objects rendered on different axes)
	 * @param mirror = mirror on the yz-plane
	 * @param swapTriOrder = switch the order the vertices of each triangle is entered (to correct lighting and backface culling)
	 * @return array of triangles that make up the 3D object
	 */
	@SuppressWarnings("unchecked")
	public Triangle[] getT(int numTypes, int offset, float scale, float distanceFromO, Color color, boolean swapYZ, boolean swapTriOrder, boolean mirror, boolean rotate180, boolean smoothTris, boolean edgeDiscrimination, float discriminationValue, boolean skipBefore) {
		
		float[] v = meshArray(vertices);
		if (skipBefore)
			v = removeBefore(v);
		v = shave(v, numTypes, offset);
		Vector[] pos = toVector(meshArray(meshPositions));
		
		if (mirror) {
			boolean[] isCopied = new boolean[pos.length];							//ones on yz-plane need not be copied
			int skips = 0;
			for (int x = 0; x < pos.length; x++) {
				isCopied[x] = true;
				if (pos[x].getX() == 0) {
					isCopied[x] = false;
					skips ++;
				}
			}
			Vector[] temp = pos;
			pos = new Vector[temp.length * 2 - skips];
			int p = 0;																//absolute position that includes skips
			for (int x = 0; x < pos.length && p < temp.length * 2; x++) {
				if (x < temp.length) {
					pos[x] = temp[x];
				} else {
					while (!isCopied[p - temp.length]) {
						p++;
						if (p < temp.length * 2)
							continue;
					}
					pos[x] = new Vector(temp[p - temp.length]);
					pos[x].setX(-pos[x].getX());
				}
				p++;
			}
			float[] tem = v;
			v = new float[tem.length * 2];
			for (int x = 0; x < v.length; x++) {
				if (x < tem.length) {
					v[x] = tem[x];
				} else {
					if (!isCopied[(int) tem[x - tem.length]])
						v[x] = tem[x - tem.length];
					else
						v[x] = tem[x - tem.length] + temp.length - total(isCopied, (int) tem[x - tem.length]);
				}
			}
			for (int x = tem.length; x < v.length; x += 3) {
				float hold = v[x + 1];
				v[x + 1] = v[x + 2];
				v[x + 2] = hold;
			}
		}
		
		for (int x = 0; x < pos.length; x++) {
			pos[x].subtract(0, 0, distanceFromO);
		}
		
		Triangle[] ret = new Triangle[v.length / 3];
		Object[] triangleConnections = new Object[pos.length];			//each position in array holds a list of the numbers corresponding to every triangle touching that point
		Object[] triangleConnectionsVertices = new Object[pos.length];  //each position holds a list of the numbers corresponding to which of the 3 vertices of each Triangle in triangleConnections is touching the given point
		
		for (int x = 0; x < pos.length; x++) {
			pos[x].multiply(scale);
		}
		
		if (smoothTris) {
			for (int x = 0; x < pos.length; x++) {
				triangleConnections[x] = new ArrayList<Integer>();
				triangleConnectionsVertices[x] = new ArrayList<Integer>();
			}
			
			for (int x = 0; x < ret.length; x++) {
				int p = 3 * x;
				try {
					ret[x] = new Triangle(pos[(int) v[p]], pos[(int) v[p + 1]], pos[(int) v[p + 2]], color);
					ret[x].setNormal();
					((ArrayList<Integer>) triangleConnections[(int) v[p]]).add(x);
					((ArrayList<Integer>) triangleConnections[(int) v[p + 1]]).add(x);
					((ArrayList<Integer>) triangleConnections[(int) v[p + 2]]).add(x);
					((ArrayList<Integer>) triangleConnectionsVertices[(int) v[p]]).add(1);
					((ArrayList<Integer>) triangleConnectionsVertices[(int) v[p + 1]]).add(2);
					((ArrayList<Integer>) triangleConnectionsVertices[(int) v[p + 2]]).add(3);
				} catch (ArrayIndexOutOfBoundsException a) { System.err.println("Incorrect NumTypes"); return null; }
			}
		} else {
			for (int x = 0; x < ret.length; x++) {
				int p = 3 * x;
				ret[x] = new Triangle(pos[(int) v[p]], pos[(int) v[p + 1]], pos[(int) v[p + 2]], color);
				ret[x].setNormal();
			}
		}
		
		if (swapYZ) {
			for (int x = 0; x < ret.length; x++) {
				ret[x].getV1().setZ(ret[x].getV1().setY(ret[x].getV1().getZ()));
				ret[x].getV2().setZ(ret[x].getV2().setY(ret[x].getV2().getZ()));
				ret[x].getV3().setZ(ret[x].getV3().setY(ret[x].getV3().getZ()));
				ret[x].setNormal();
			}
		}
		
		if (swapTriOrder) {
			for (int x = 0; x < ret.length; x++) {
				ret[x].getV2().set(ret[x].getV3().set(ret[x].getV2()));
				ret[x].setNormal();
			}
			if (smoothTris) {
				for (int e = 0; e < triangleConnectionsVertices.length; e++) {
					for (int y = 0; y < ((ArrayList<Integer>) triangleConnectionsVertices[e]).size(); y++) {
						if (((ArrayList<Integer>) triangleConnectionsVertices[e]).get(y) == 2)
							((ArrayList<Integer>) triangleConnectionsVertices[e]).set(y, 3);
						else if (((ArrayList<Integer>) triangleConnectionsVertices[e]).get(y) == 3)
							((ArrayList<Integer>) triangleConnectionsVertices[e]).set(y, 2);
					}
				}
			}
		}
		
		if (rotate180) {
			for (int x = 0; x < ret.length; x++) {
				ret[x].getV1().setX(-ret[x].getV1().getX());
				ret[x].getV1().setZ(-ret[x].getV1().getZ());
				ret[x].getV2().setX(-ret[x].getV2().getX());
				ret[x].getV2().setZ(-ret[x].getV2().getZ());
				ret[x].getV3().setX(-ret[x].getV3().getX());
				ret[x].getV3().setZ(-ret[x].getV3().getZ());
				ret[x].setNormal();
			}
		}
		
		if (smoothTris) {
			for (int x = 0; x < triangleConnections.length; x++) {
				Vector[] norms = new Vector[((ArrayList<Integer>) triangleConnections[x]).size()];
				for (int y = 0; y < norms.length; y++) {
					norms[y] = (ret[((ArrayList<Integer>) triangleConnections[x]).get(y)].getNormal());
				}
				Vector[] norm;
				int[] which;
				if (edgeDiscrimination) {
					ArrayList<Vector[]> n = new ArrayList<Vector[]>();
					which = new int[((ArrayList<Integer> )triangleConnections[x]).size()];
					next: for (int y = 0; y < norms.length; y++) {
						if (n.size() > 0) {
							for (int z = 0; z < n.size(); z++) {
								for (int w = 0; w < n.get(z).length; w++) {
									if (n.get(z)[w].dot(norms[y]) > discriminationValue) {
										n.set(z, add(n.get(z), norms[y]));
										which[y] = z;
										continue next;
									}
								}
							}
							n.add(new Vector[]{norms[y]});
							which[y] = n.size() - 1;
						} else {
							n.add(new Vector[]{norms[y]});
							which[y] = 0;
						}
					}
					
					norm = new Vector[n.size()];
					for (int y = 0; y < n.size(); y++) {
						for (Vector u : n.get(y)) {
							if (norm[y] == null) norm[y] = new Vector(u);
							else norm[y].add(u);
						}
						norm[y].normalize();
					}
				} else {
					norm = new Vector[1];
					norm[0] = new Vector(0, 0, 0);
					for (Vector ne : norms) {
						norm[0].add(ne);
					}
					which = new int[norms.length];
					for (int f = 0; f < which.length; f++)
						which[f] = 0;
					norm[0].normalize();
					
				}
				for (int y = 0; y < ((ArrayList<Integer> )triangleConnections[x]).size(); y++) {
					switch (((ArrayList<Integer>) triangleConnectionsVertices[x]).get(y)) {
					case 1:
						ret[((ArrayList<Integer>) triangleConnections[x]).get(y)].setNorm1(new Vector(norm[which[y]]));
						break;
					case 2:
						ret[((ArrayList<Integer>) triangleConnections[x]).get(y)].setNorm2(new Vector(norm[which[y]]));
						break;
					case 3:
						ret[((ArrayList<Integer>) triangleConnections[x]).get(y)].setNorm3(new Vector(norm[which[y]]));
					}
				}
			}
		}
		return ret;
	}
	
	public static float[] removeBefore(float[] v) {
		float[] ret = new float[(v.length * 3) / 4];
		for (int x = 0; x < v.length / 4; x++) {
			ret[3 * x] = v[4 * x + 1];
			ret[3 * x + 1] = v[4 * x + 2];
			ret[3 * x + 2] = v[4 * x + 3];
		}
		return ret;
	}
	
	public static Vector[] add(Vector[] v, Vector u) {
		Vector[] ret = new Vector[v.length + 1];
		for (int x = 0; x < v.length; x++) {
			ret[x] = v[x];
		}
		ret[v.length] = u;
		return ret;
	}
	
	public int total(boolean[] b, int index) {
		int ret = 0;
		for (int x = 0; x <= index && x < b.length; x++) {
			if (!b[x]) ret++;
		}
		return ret;
	}
	
	public float[] shave(float[] f, int numTypes, int offset) {
		float[] ret = new float[f.length / numTypes];
		for (int x = 0; x < ret.length; x++)
			ret[x] = f[x * numTypes + offset];
		return ret;
	}
	
	public Line[] getRa() {
		Vector[] v = toVector(meshArray(meshPositions));
		Line[] line = new Line[v.length - 1];
		v[0].multiply(100);
		for (int x = 0; x < v.length - 1; x++) {
			v[x + 1].multiply(100);
			line[x] = new Line(v[x], v[x+1], Color.FOREST_GREEN);
		}
		return line;
	}
	
	public static float[] meshArray(String s) {
		
		float[] array = new float[0];	//mesh positions array
		boolean positive = true;
		float value = 0;				//value of whole float being constructed
		char val;						//value of single digit at pos
		int pastDecimal = 0;			//distance past the decimal
		boolean power = false;			//if true, the number is in scientific notation
		int pow = 0;					//when in scientific notation, the power the 10 is raised to
		boolean powPositive = true;		//false if the exponent the 10 is raised to is negative
		for (int pos = 0; pos < s.length(); pos++) {
			val = s.charAt(pos);		// '0' = 48, '1' = 49, ...
			switch (val) {
			case '-':
				if (power)
					powPositive = false;
				else
					positive = false;
				break;
			case ' ':
				if (!positive)
					value *= -1;
				if (!powPositive)
					pow *= -1;
				array = add(array, (float) (value * Math.pow(10, pow)));
				positive = true;
				value = 0;
				pastDecimal = 0;
				power = false;
				pow = 0;
				powPositive = true;
				break;
			case '.':
				pastDecimal = 1;
				break;
			case 'e':
			case 'E':
				power = true;
				break;
			default:
				if (power) {
					pow = pow * 10 + (val - 48);
				}
				else {
					if (pastDecimal > 0)
						value += (float) ((val - 48) / Math.pow(10, pastDecimal - 1));
					else
						value = value * 10 + (val - 48);
				}
			}
			if (pastDecimal > 0) pastDecimal ++;
		}
		if (value != 0) {
			if (!positive)
				value *= -1;
			array = add(array, value);
		}
		return array;
	}
	
	public static Vector[] toVector(float[] a) {
		Vector[] ret = new Vector[a.length / 3];
		for (int x = 0; x < a.length / 3; x++) {
			ret[x] = new Vector(a[3 * x], a[3 * x + 1], a[3 * x + 2]);
		}
		return ret;
	}
	
	public static float[] add(float[] a, float n) {
		float[] b = new float[a.length + 1];
		for (int x = 0; x < a.length; x++) {
			b[x] = a[x];
		}
		b[a.length] = n;
		return b;
	}
	
	
	
	
	
	
	public static ArrayList<Shape> interpretASCIIString(String s) {
		int v = 2510 * 3;
		ArrayList<Color> funColors = new ArrayList<Color>((int) v / 3);
		ArrayList<Shape> objects = new ArrayList<Shape>();
		for (int x = 0; x < v / 3; x ++) {
			//funColors.add(new Color((int) (Math.random() * Math.pow(2, 23))));
		}
		for (int x = 0; x < v / 3; x ++) {
			funColors.add(Color.SOFT_WHITE);
		}
		int div = 1;
		int x = 0;
		boolean pastDecimal = false;
		boolean negative = false;
		float[] vertices = new float[v];
		int place = 0;
		for (x = 0; place < v; x++) {
			while (x < s.length() && s.charAt(x) == ' ') {
				x++;
			}
			div = 1;
			pastDecimal = false;
			negative = false;
			while (x < s.length() && s.charAt(x) != ' ') {
				if (s.charAt(x) == '-') {
					x ++;
					negative = true;
				}
				if (s.charAt(x) == '.') {
					x++;
					pastDecimal = true;
				}
				if (pastDecimal == true)
					div *= 10;
				vertices[place] = vertices[place] * 10 + Integer.parseInt(s.substring(x, x + 1));
				x++;
			}
			vertices[place] /= div;
			if (negative)
				vertices[place] *= -1;
			place ++;
			div = 1;
			pastDecimal = false;
			negative = false;
		}
		int z = x;
		for (x = z; x < s.length(); x++) {
			Color[] c = new Color[3];
			float sub[] = new float[9];
			while (x < s.length() && s.charAt(x) == ' ') {
				x ++;
			}
			x ++;
			int a = 0;
			while (x < s.length() && a < 3) {
				if (s.charAt(x) != ' ') {
					int num = 0;
					while (x < s.length() && s.charAt(x) != ' ') {
						num = num * 10 + Integer.parseInt(s.substring(x, x + 1));
						x ++;
					}
					sub[a * 3] = vertices[num * 3];
					sub[a * 3 + 1] = vertices[num * 3 + 1];
					sub[a * 3 + 2] = vertices[num * 3 + 2];
					c[a] = funColors.get(num);
					a ++;
				} else 
					x ++;
			}
			objects.add(new Triangle(sub[0], sub[2], sub[1], sub[6], sub[8], sub[7], sub[3], sub[5], sub[4], c[0]));
		}
		return objects;
	}
	
	public static Triangle[] toTri(ArrayList<Shape> a) {
		Triangle[] ret = new Triangle[a.size()];
		for (int x = 0; x < ret.length; x++) {
			ret[x] = (Triangle) a.get(x);
		}
		return ret;
	}
